INSERT INTO `mensajes_internos` VALUES(4, 'Marce cargue lo que le adelante hoy a alberto como RETIRO exepcionalmente hasta que subas "pago personal" . gracias', '2017-06-19', 'S', 5);
INSERT INTO `mensajes_internos` VALUES(5, 'CAJA ROXANA\r\nabri caja con         $60 \r\n4 libres              $720\r\nalberto              $-500\r\ncambio flecha         $30\r\n2 cuota acro          $1140\r\n1 cuota acro+inscrip $650 \r\nretiro                $2090 \r\n\r\nCAJA FLECHA (copio textual)\r\n4 criollos\r\n4 medialunas \r\n3 pepsi de vidrio\r\n3 pebetes promo\r\n2 medialunas y pepsi d vidrio\r\n2 almohaditas \r\nprestamo cambio ro $-30', '2017-06-19', 'S', 5);
INSERT INTO `mensajes_internos` VALUES(6, 'Flecha, anote a Facu Prieto pepsi de $15, no encontre su deuda\r\nPago Santiago...$10, no si si es DESVOTS...\r\n\r\nLa caja abri con 124.50 pero decia 100', '2017-06-21', 'S', 1);
INSERT INTO `mensajes_internos` VALUES(7, 'CAJA ROXANA DIA 19/06/17\r\n\r\nabri caja con         $60 \r\n4 libres              $720\r\nalberto              $-500\r\ncambio flecha         $30\r\n2 cuota acro JUANA DE LOS SANTOS+fATIMA DE LOS SANTOS $1140\r\n1 cuota acro+inscrip LUCILA FERRER  $650 \r\nretiro                $2090 ', '2017-06-22', 'S', 5);
INSERT INTO `mensajes_internos` VALUES(8, 'hola marce me la mande en una carga del dia 23/06 cod vta 32 . cargue clase d acrobacia en vez d parkour de tomas massa. perdon tenia varia gente y m despite. no volvera a pasar. ', '2017-06-23', 'S', 5);
INSERT INTO `mensajes_internos` VALUES(9, 'MARCE CUANDO ABRISTE CON 124? Y CUANDO DECIA 100? ', '2017-06-28', 'S', 4);
INSERT INTO `mensajes_internos` VALUES(10, 'hOLA MArce el dia de hoy entraron tres niños libres , la mama d uno de ellos comenzo a quejarse porque las camas elasticas estaban ocupadas , se quejo tres veces y la ultima pido devolucion  de dinero MUY enojada por lo que acorde devolver el monto de $100 x niño ya que los chicos solo estuvieron usando las rampas en todo momento. ', '2017-07-19', 'S', 5);
INSERT INTO `mensajes_internos` VALUES(11, 'hola marce. haceme precios redondos porfavor por el tema del cambio.  ej: los bocaditos block $10- galletas y alfajores $20 o $23  barritas cereal $13 o $15 - porque sino me quedan debiendo o debo las monedas y no es cuestion. graciaaaaaas !!!!!!', '2017-07-21', 'S', 5);
